pragma solidity ^0.4.11;

/**
 * @title Monthly
 * @dev Base contract which allows children to determine the current month.
 * WARNING : all months are approximated to be 30.436875 days
 */
contract Monthly {
  // (365*year + year/4 - year/100 + year/400) == 3652425 * year / 10000

  uint256 internal currentYear; 
  uint256 internal currentMonth;
  uint256 internal nextMonthBegin;

  /**
   * @dev function returning the year/month of a timestamp
   */
  function toDate(uint256 timestamp) pure public returns (uint256[2]) {
    uint256 dayNumber = timestamp / 86400;
    uint256 year = (10000*dayNumber + 14780)/3652425;

    uint256 dayNumberInYear = dayNumber - (3652425 * year / 10000);
    if (dayNumberInYear < 0) {
      year = year - 1;
      dayNumberInYear = dayNumber - (3652425 * year / 10000);
    }
    uint256 month = (100*dayNumberInYear + 52)/3060 + 1;

    return [year+1970, month];
  }

  /**
   * @dev function incrementing the current month and current year
   * defines month and year if undefined
   */
  function incrMonth() internal {
    if(nextMonthBegin == 0) {
      uint256[2] memory date = toDate(now);
      currentYear = date[0];
      currentMonth = date[1];
    } else {
      if(currentMonth == 12) {
        currentMonth=1;
        currentYear=currentYear+1;
      } else {
        currentMonth=currentMonth+1;
      }
    }

    nextMonthBegin=86400 * (((currentYear-1970)*3652425 - 14780)/10000 + (3060*(currentMonth) - 52)/100 + 1);
  }

  /**
   * @dev function returning the id of the current month
   */
  function getCurrentMonth() public returns (uint256) {
    if(nextMonthBegin <= now) {
      incrMonth();
    }
    return currentMonth;
  }

  /**
   * @dev function returning the id of the current year
   */
  function getCurrentYear() public returns (uint256) {
    if(nextMonthBegin <= now) {
      incrMonth();
    }
    return currentYear;
  }


}

